import React from "react";
import ListProducts from "../tabProduct/ListProducts"
import CardProducts from "../card/CardProducts"


const ShoppingCart = ({ handleClick }) => {
  return (
    <section>
      {ListProducts.map((item) => (
        <CardProducts key={item.id} item={item} handleClick={handleClick} />
      ))}
    </section>
  );
};

export default ShoppingCart;
